        const svgPath2 = document.querySelectorAll('.path2');

        const svgText2 = anime({
            targets: svgPath2,
            strokeDashoffset: [anime.setDashoffset, 0],
            easing: 'linear',
            duration: 1000,
            delay: function (el, i) { return i * 4 },
            direction: 'alternate',
            loop: true
        });

        const svgmessage = document.querySelector('.message');
        const message = "For personalized services tailored to your needs, please feel free to reach out. We specialize in customizing wishes, proposals, and various forms of digital art. Kindly direct message us to discuss your requirements.";

        // Function to create individual animations for each character in the message
        function createTextAnimations(message, target) {
            const linkField = document.createElement("a");
            linkField.textContent = "Click Me.";
            linkField.href = "https://dayanidiportfolio.github.io";
            for (let i = 0; i < message.length; i++) {
                const charElement = document.createElement('span');
                charElement.textContent = message[i];
                charElement.classList.add('char');
                target.appendChild(charElement);
                anime({
                    targets: charElement,
                    opacity: [0, 1],
                    easing: 'easeInOutQuad',
                    duration: 100,
                    delay: i * 100,
                    complete: () => {
                        if (i === message.length - 1) {
                            target.appendChild(linkField);
                        }
                    }
                });

            }


        }

        createTextAnimations(message, svgmessage);

        if (true) {
